import React, { Component } from "react";

export default class Nopage extends Component {
  render() {
    return (
      <div>
        <h1 id="title">404</h1>
        <p id="404meaning">Oh no, la pagina no existe</p>
        <Link to='/home'>Regresar</Link>
      </div>
    );
  }
}
